import { Stack } from '@mui/system'
import React from 'react';
import { category } from '../../Constants/Constants';

const Category = () => {
return (
    <Stack>
        {category.map(item => (
            <button key={item.name} className='category-btn'>

            </button>
        ))}
    </Stack>
)
}

export default Category
